INSERT INTO `garuda_documents` (`id`, `author_order`, `accreditation`, `title`, `abstract`, `publisher_name`, `publish_date`, `publish_year`, `doi`, `citation`, `source`, `source_issue`, `source_page`, `url`, `authors_id`, `idsubmission`) VALUES
(1659580, '2 of 3', '', 'PERENCANAAN SISTEM PHOTOVOLTAIC BEBAN ARUS SEARAH TERHUBUNG JALA-JALA', 'Photovoltaic (PV) systems utilize solar energy as a renewable energy source. A PV system can be connected to utility networks to ensure reliability. This study proposes a PV system model with direct current load on residential installation connected to utility grid. Optimal analysis of PV systems is done by comparing the architecture, energy production, losses, reliability and economic aspect considering the constraints of renewable energy fraction and capacity shortage. The results show PV system connections with grid reduce the capacity requirements of photovoltaic modules and batteries with a good level of reliability. The grid connected system equipped with batteries has the best level of renewable energy utilization with an excess electricity value of 2.19%. From an economic aspect, the system with the lower renewable energy fraction has less energy costs. This is due to the high price of PV components compared to the price of electricity from utility. Keyword : photovoltaic system, DC load, grid connected, optimal, utilization, reliability', 'Institut Teknologi Nasional Yogyakarta', '2020-05-01', 2020, 'DOI: 10.33579/krvtk.v5i1.1565', '', 'KURVATEK', 'Vol 5 No 1 (2020): April 2020', '19-28', '', 6696255, 12),
(1794361, '2 of 2', '2', 'Analisis Sistem Photovoltaic Beban Arus Searah Terhubung Jala PLN dengan Penyearah Terkendali', 'Photovoltaic (PV) systems can be connected to the utility grid to ensure the reliability and continuity of the electrical energy supply. Although the output of the PV modules and many electrical loads are direct current (DC), most grid connected PV systems use alternating current (AC) grid through the inverter. This study presents an analysis of DC microgrid PV system connected to PLN utility grid using controlled rectifier. The controlled rectifier circuit uses a thyristor which can be controlled at its ignition angle to regulate the output voltage and current supplied from utility. The proposed PV system configuration simulations are performed using PSIM software. The system supplies resistive loads in the form of DC lights. Simulations are carried out with variations in load resistance and the thytistor ignition angle. The simulation results show the rectifier circuit has a voltage ripple of 1.57 V (6.47%). While the efficiency of the system under various loading conditions and ignition angle varies between 95.08%97.72%. The highest system efficiency is obtained under high thyristor ignition conditions.', 'Universitas Syiah Kuala', '2020-08-12', 2020, 'DOI: 10.17529/jre.v16i2.15698', '', 'Jurnal Rekayasa Elektrika', 'Vol 16, No 2 (2020)', '', 'http://www.jurnal.unsyiah.ac.id/JRE/article/downloadSuppFile/15698/2913', 6696255, NULL),
(1906259, '4 of 4', '6', 'Utilization of Digital Information Boards as Media Information in Rural Areas: Pemanfaatan Papan Informasi Digital Sebagai Media Informasi di Wilayah Perdesaan', 'Information is one of the most important human needs. The term information is often understood as an aid in decision making process needed for the decision makers. Subdistrict offices, village offices, or other government offices are required to be able to provide various information needed by the community. The presence of signage as a medium for delivering information at the subdistrict offices, village offices or other government offices is still considered an important medium in fulfilling information according to the community needs. Digital Signage is one of the electronic media which is currently often used in fulfilling the required information. Digital signage is a one-way digital information service. This community service activity was carried out with the aim of building a digital signage by using an Android TV device. The use of this Android TV-based digital signage can assist village officials in compiling digital-based information, where its use is also considered as easy as using an Android-based mobile device. Abstrak Informasi merupakan kebutuhan yang sangat penting, dasar dalam pengambilan keputusan salah satunya adalah bersumber dari informasi tersebut. Kantor Kelurahan, kantor desa ataupun kantor pemerintahan lain syarat akan informasi yang dibutuhkan oleh masyarakat umum. Kehadiran papan pengumuman sebagai media penyampai informasi di Kantor Kelurahan, kantor desa ataupun kantor pemerintahan lain hingga saat ini tetap menjadi hal penting yang dapat digunakan untuk memenuhi kebutuhan masyarakat akan informasi. Papan Informasi digital (Digital Signage) merupakan salah satu media elektronik yang saat ini sering digunakan untuk memberikan informasi yang dibutuhkan. Papan pengumuman digital (digital signage) adalah Sebuah layanan informasi berbasis digital satu arah. Tujuan dari kegiatan pengabdian kepada masyarakat ini adalah membangun papan informasi digital dengan menggunakan menggunakan perangkat android tv. Hadirnya Papan informasi digital berbasis Android TV ini memberikan kemudahan bagi perangkat desa dalam membuat informasi berbasis digital dikarenakan kemudahan penggunaannya yang sama dengan perangkat handphone berbasis android.', 'Yayasan Ahmar Cendekia Indonesia', '2021-01-05', 2020, 'DOI: 10.35877/454RI.mattawang173', '', 'Mattawang: Jurnal Pengabdian Masyarakat', 'Vol. 1 No. 1 (2020)', '1-7', 'https://jurnal.ahmar.id/index.php/mattawang/article/view/173/139', 6696255, NULL),
(1967810, '2 of 3', '', 'Pengembangan Sistem Informasi Pemantauan Kuis dan Tugas pada Learning Management Systems Moodle', 'Perkembangan sistem informasi dewasa ini telah merambah ke berbagai elemen kehidupan, salah satunya adalah pada bidang akademik. Salah satu yang sangat populer adalah sistem manajemen pembelajaran online, dan contoh dari perangkat lunak yang digunakan adalah Moodle. Moodle merupakan platform pembelajaran yang dirancang untuk memberi para pendidik, administrator, dan pelajar dengan satu sistem yang kuat, aman, dan terintegrasi untuk menciptakan lingkungan belajar yang dipersonalisasi. eLDirU merupakan platform pembelajaran berbasis moodle. eLDirU memiliki banyak fitur seperti mengakses course atau matakuliah, melakukan pengumpulan tugas, serta mengerjakan kuis yang diberikan oleh dosen. Dengan banyaknya jumlah kelas dan Dengan banyaknyan kuis serta tugas yang diupload pada eLDirU, menimbulkan permasalahan bagi admin untuk mengelola kuis dan tugas secara manual. yang perlu adanya suatu sistem monitoring agar user maupun admin dapat dengan mudah memfilter kuis dan tugas yang sudah diupload pada eLDirU. Dengan dikembangkannya aplikasi sistem informasi monitoring kuis dan tugas, masalah filterisasi kuis dan tugas pada eLDirU dapat teratasi sekaligus membuat kuis dan tugas mampu dikelola dengan baik oleh admin tanpa perlu melakukan pengecekan disetiap masing-masing kelas.', 'CV Infinite Corporation', '2021-03-28', 2021, 'DOI: 10.52436/1.jpti.5', '', 'Jurnal Pendidikan dan Teknologi Indonesia', 'Vol 1 No 3 (2021): JPTI - Maret 2021', '97-102', 'https://jpti.journals.id/index.php/jpti/article/view/5/10', 6696255, NULL),
(2014018, '1 of 3', '3', 'Desain Ulang Modul Paten Dan Cipta Dari Sistem Informasi Hak Kekayaan Intelektual Universitas Jenderal Soedirman', 'Sentra HKI adalah sistem informasi yang dikembangkan oleh Puslit Hak Kekayaan Intelektual dan Sertifikasi Produk LPPM Universitas Jenderal Soedirman untuk mengarsipkan dokumen HKI secara digital seperti Paten, Indikasi Geografis, Cipta, Merek, PVT (Perlindungan Varietas Tanaman), Rahasia Dagang, DTLST (Desain Tata Letak Sikuit Terpadu), dan Desain Industri. Sentra HKI juga digunakan untuk mengelola pengajuan HKI baru dan memantau status HKI yang saat ini dimiliki oleh LPPM UNSOED. Kondisi saat ini Sentra HKI berjalan tidak sesuai dengan fungsinya, menu selain Paten dan Cipta tidak bisa diakses, selain itu menu paten dan cipta tidak mendukung pengarsipan dokumen berdasarkan riwayatnya karena setiap melakukan pembaharuan dokumen, dokumen lama akan terhapus dengan dokumen baru. Hal ini juga terlihat pada struktur tampilan layar menu paten dan cipta yang juga tidak mendukung pengarsipan dokumen berdasarkan riwayat dan diikuti dengan struktur basis data yang juga tidak mendukung pengarsipan dokumen berbasis riwayat. Dengan melalui pengembangan aplikasi berupa desain ulang baik struktur basis data dan struktur tampilan yang mendukung pengarsipan dokumen berbasis riwayat Sentra HKI kembali mampu mengelola pengajuan HKI baru dan memantau status HKI yang dikelola oleh LPPM UNSOED.', 'Jenderal Soedirman University', '2020-08-24', 2020, 'DOI: 10.20884/1.dr.2020.16.2.348', '', 'Dinamika Rekayasa', 'Vol 16, No 2 (2020): Jurnal Ilmiah Dinamika Rekayasa - Agustus 2020', '91-96', 'https://dinarek.unsoed.ac.id/jurnal/index.php/dinarek/article/view/348/pdf', 6696255, NULL),
(2229813, '3 of 3', '', 'Purwarupa Sistem Pakar Dengan Metode Forward Chaining Dan Certainty Factor Untuk Mendeteksi Penyakit Kanker Payudara', 'Sistem pakar adalah sebuah sistem yang berusaha mengadopsi pengetahuan manusia ke komputer, agar komputer dapat menyelesaikan suatu permasalahan seperti yang biasanya dilakukan oleh para ahli. Kanker merupakan penyakit yang disebabkan oleh pertumbuhan sel yang tidak normal dan tidak terkendali serta menekan sel-sel yang normal. Sejumlah sel dalam payudara tumbuh dan berkembang dengan tidak terkendali inilah yang disebut dengan kanker payudara. Oleh karena itu, penelitian ini mencoba untuk membangun sebuah aplikasi agar dapat mengetahui gejala awal dari penyakit kanker payudara. Aplikasi ini berbasis website dengan menggunakan metode waterfall yang merupakan suatu metode dalam pengembangan perangkat lunak dengan melalui 5 tahapan yaitu, requirement analysis and definition, system and software design, implementation and unit testing, integration and system testing, dan operation and maintenance. Website ini diimplementasikan dengan menggunakan bahasa pemrograman PHP dan basis data MySQL. Pengambilan hasil kesimpulan untuk hasil diagnosa didasarkan pada hasil penelusuran secara forward chaining dan perhitungan secara certainty factor. Pengujian sistem pakar dilakukan dengan menggunakan black-box testing dan usability testing. Pengujian dengan metode black-box terhadap fungsionalitas dari setiap bagian aplikasi sistem pakar, didapatkan hasil yang sudah sesuai dengan tujuan yang diharapkan. Sedangkan pengujian dengan metode usability testing terhadap 50 responden yang menggunakan aplikasi sistem pakar, didapatkan hasil penerimaan yang baik memenuhi kelima aspek usability testing yaitu learnability, efficiency, memorability, errors, dan satisfaction dengan nilai persentase sebesar 85%.', 'CV Infinite Corporation', '2021-07-09', 2021, 'DOI: 10.52436/1.jpti.53', '', 'Jurnal Pendidikan dan Teknologi Indonesia', 'Vol 1 No 6 (2021): JPTI - Juni 2021', '247-259', 'https://jpti.journals.id/index.php/jpti/article/view/53/30', 6696255, NULL),
(2290332, '3 of 3', '2', 'Purwarupa Sistem Deteksi COVID-19 Berbasis Website Menggunakan Algoritma Convolutional Neural Network', 'COVID-19 is a disease caused by coronavirus 2 (SARS-CoV-2). This virus belongs to the group of viruses that infect the respiratory system. Furthermore, the rapid rate of spread has made several countries implement a policy of implementing a lockdown to prevent the spread of this virus. In Indonesia, the government implemented the policy of \"Pemberlakuan Pembatasan Kegiatan Masyarakat (PPKM)\" to suppress the spread of this virus. Based on data from the Task Force for the Acceleration of Handling COVID-19 of the Republic of Indonesia, the number of confirmed positive cases as of August 6, 2021 is 3,568,331 people with a death toll of 102,375. The existence of the COVID-19 vaccine is currently under threat, this is due to the emergence of new variants of the COVID-19 virus. The RT-PCR method as the main standard used throughout the world in detecting this virus has a fairly high specificity, which is around 95 percent, which is a manual process that can only be done by health workers. In addition, this test takes a long time and the number of testing facilities is limited. The presence of X-ray scanning machines in hospitals can be used to increase the availability of COVID-19 testing facilities. The thoracic x-ray image generated by the scanner can be used to detect the virus easily, quickly and precisely. In this study, a website-based system was designed to detect the COVID-19 virus in thoracic x-ray images using a convolutional neural network algorithm. The results obtained show that this system is able to classify chest x-ray images into three classes, namely COVID-19, Viral Pneumonia, and normal. The accuracy value obtained is 89.6% and the F1 value is 87.9%.', 'Ikatan Ahli Informatika Indonesia (IAII)', '2021-10-24', 2021, 'DOI: 10.29207/resti.v5i5.3450', '', 'Jurnal RESTI (Rekayasa Sistem dan Teknologi Informasi)', 'Vol 5 No 5 (2021): Oktober2021', '876 - 883', 'https://jurnal.iaii.or.id/index.php/RESTI/article/view/3450/485', 6696255, NULL),
(2655099, '4 of 4', '6', 'Utilization of Digital Information Boards as Media Information in Rural Areas: Pemanfaatan Papan Informasi Digital Sebagai Media Informasi di Wilayah Perdesaan', 'Information is one of the most important human needs. The term information is often understood as an aid in decision making process needed for the decision makers. Subdistrict offices, village offices, or other government offices are required to be able to provide various information needed by the community. The presence of signage as a medium for delivering information at the subdistrict offices, village offices or other government offices is still considered an important medium in fulfilling information according to the community needs. Digital Signage is one of the electronic media which is currently often used in fulfilling the required information. Digital signage is a one-way digital information service. This community service activity was carried out with the aim of building a digital signage by using an Android TV device. The use of this Android TV-based digital signage can assist village officials in compiling digital-based information, where its use is also considered as easy as using an Android-based mobile device. Abstrak Informasi merupakan kebutuhan yang sangat penting, dasar dalam pengambilan keputusan salah satunya adalah bersumber dari informasi tersebut. Kantor Kelurahan, kantor desa ataupun kantor pemerintahan lain syarat akan informasi yang dibutuhkan oleh masyarakat umum. Kehadiran papan pengumuman sebagai media penyampai informasi di Kantor Kelurahan, kantor desa ataupun kantor pemerintahan lain hingga saat ini tetap menjadi hal penting yang dapat digunakan untuk memenuhi kebutuhan masyarakat akan informasi. Papan Informasi digital (Digital Signage) merupakan salah satu media elektronik yang saat ini sering digunakan untuk memberikan informasi yang dibutuhkan. Papan pengumuman digital (digital signage) adalah Sebuah layanan informasi berbasis digital satu arah. Tujuan dari kegiatan pengabdian kepada masyarakat ini adalah membangun papan informasi digital dengan menggunakan menggunakan perangkat android tv. Hadirnya Papan informasi digital berbasis Android TV ini memberikan kemudahan bagi perangkat desa dalam membuat informasi berbasis digital dikarenakan kemudahan penggunaannya yang sama dengan perangkat handphone berbasis android.', 'Yayasan Ahmar Cendekia Indonesia', '2021-01-05', 2020, 'DOI: 10.35877/454RI.mattawang173', '', 'Mattawang: Jurnal Pengabdian Masyarakat', 'Vol. 1 No. 1 (2020)', '1-7', 'https://jurnal.ahmar.id/index.php/mattawang/article/view/173/139', 6696255, NULL),
(3076899, '3 of 5', '4', 'Aplikasi Bot Telegram Pada Sistem Presensi dan Pengukuran Suhu Tubuh Berbasis IoT', 'Coronavirus atau virus Covid-19 merupakan virus berbahaya dan sangat menular. Berdasarkan data dari worldometers.info per tanggal 30 Januari 2022 terdapat 375,001,247 kasus virus Covid-19 di seluruh dunia. Mengingat masih tingginya kasus virus Covid-19, maka diperlukan upaya untuk mencegah penyebaran virus Covid-19. Selain menerapkan perilaku hidup sehat, upaya pencegahan penyebaran virus Covid-19 juga dapat dilakukan dengan menciptakan inovasi teknologi. Salah satu inovasi teknologi tersebut adalah pemanfaatan bot Telegram pada sistem presensi dan pengukuran suhu tubuh berbasis internet of things (IoT) sebagai media pemantauan data, media pelaporan, dan media notifikasi. Bot Telegram ini berfungsi untuk menjalankan perintah dan memberikan pesan balasan sesuai dengan permintaan pengguna. Dalam penelitian ini, bot Telegram dibuat dengan menggunakan bahasa pemrograman PHP yang dikombinasikan dengan sebuah framework agnostic BotMan. Adapun metode pertukaran informasi pada bot Telegram dibangun dengan menggunakan metode webhook sehingga proses pertukaran informasi dapat dilakukan secara real time tanpa membutuhkan jeda waktu tertentu. Bot Telegram yang telah dibuat kemudian diuji dengan menggunakan black box testing berbasis equivalence partitions. Dari hasil pengujian, bot Telegram mampu menjalankan perintah pengguna sesuai dengan harapan sebanyak 20 dari 20 kali pengujian. Selain menguji kemampuan bot Telegram dalam menjalankan fungsinya, kemampuan bot Telegram dalam menanggapi perintah pengguna juga turut diuji. Dari 15 kali pengujian response time, bot telegram memiliki total rata  rata response time keseluruhan sebesar 0,9 detik yaitu termasuk ke dalam kategori cepat', 'Jurusan Teknik Elektro Universitas Trunojoyo Madura', '2022-11-28', 2022, 'DOI: 10.21107/triac.v9i3.15752', '', 'Jurnal Teknik Elektro dan Komputer TRIAC', 'Vol 9, No 3 (2022): November 2022', '113-121', 'https://journal.trunojoyo.ac.id/triac/article/view/15752/7791', 6696255, NULL),
(3115418, '4 of 4', '', 'Analisis Perbandingan Metode Certainty Factor, Dempster Shafer dan Teorema Bayes dalam Deteksi Dini Gangguan Kesehatan Mental', 'Kesehatan adalah hal yang sangat penting, karena tanpa kesehatan yang cukup, maka setiap individu akan sulit dalam melaksanakan aktivitasnya kesehariannya, baik berupa kesehatan fisik maupun mental. Dewasa ini, kesehatan mental masih menjadi hal yang sering diabaikan oleh sebagian masyarakat. Padahal gangguan kesehatan mental ini dapat menyebabkan komplikasi serius, baik pada fisik, emosi, maupun perilaku. Penelitian ini bertujuan untuk melakukan diagnosis awal terhadap gangguan kesehatan mental, sehingga dapat diminimalisir dampak yang dapat ditimbulkannya. Diagnosis awal yang dihasilkan merupakan hasil analisis berdasarkan gejala yang ditimbulkan dengan menggunakan tiga buah metode yaitu Certainty Factor, Dempster-Shafer, dan Teorema Bayes. Ketiga metode ini melakukan analisis masing-masing dengan cara mengukur tingkat keyakinan pakar dengan nilai probabilitas berdasarkan gejala yang ada. untuk dapat mengukur nilai kemungkinan seseorang menderita gangguan Kesehatan Mental, sehingga dapat mengetahui metode mana yang paling tepat digunakan. Berdasarkan hasil analisis tersebut penelitian ini menunjukan bahwa metode Certainty Factor memiliki nilai probabilitas sebesar 99,4%, metode Dempster-Shafer dengan nilai probabilitas sebesar 94% dan Teorema Bayes dengan nilai probabilitas sebesar 81.65%. Sehingga metode Certainty Factor merupakan metode yang paling tepat digunakan untuk melakukan diagnosasi penyakit ini. Pada pengujian Usability yang dilakukan website Sistem Pakar hasil implementasi ketiga metode ini diperoleh hasil sebesar 80.68%, sehingga juga dapat disimpulkan bahwa hasil pengguna cukup puas dengan sistem pakar tersebut.', 'CV Infinite Corporation', '2022-07-30', 2022, 'DOI: 10.52436/1.jpti.191', '', 'Jurnal Pendidikan dan Teknologi Indonesia', 'Vol 2 No 7 (2022): JPTI - Juli 2022', '329-339', 'https://jpti.journals.id/index.php/jpti/article/view/191/139', 6696255, NULL),
(3447741, '3 of 3', '5', 'PERANCANGAN INFRASTRUKTUR DEVOPS SISTEM INFORMASI SENTRA HKI LPPM UNSOED', 'Intellectual Property Rights are rights that arise from the results of thought processes that produce a product or process that is useful for humans. Objects regulated in IPR are works born out of human intellectual abilities. Management Information System is a planning system part of the internal control of a business which includes the use of people, documents, technology, and procedures by management accounting to solve business problems such as the cost of products, services, or a business strategy. LPPM Unsoed HKI Center as an institution tasked with managing and maintaining IPR documents collected from various organizations and individuals. This study aims to design and implement infrastructure using the DevOps method for information system development. In this method, several tools are used to build information systems, namely Linux Ubuntu 20.04, Github, Jenkins, Docker and Apache Web Server. Jenkins is a tool used to ensure continuous integration. Github as a tool to ensure continuous development and continuous integration. While docker as part to support continuous deployment. This research has several stages in the process, namely plan, code, build, test, release, deploy. The result of this research is the Unsoed Intellectual Property Rights Information System which has been successfully implemented using the DevOps method', 'Universitas Tarumanagara', '2023-04-15', 2023, 'DOI: 10.24912/tesla.v25i1.21003', '', 'TESLA: Jurnal Teknik Elektro', 'Vol 25 No 1 (2023): TESLA: Jurnal Teknik Elektro', '59-71', 'https://journal.untar.ac.id/index.php/tesla/article/view/21003/14336', 6696255, NULL),
(3522343, '1 of 3', '4', 'The SDLC Analysis for Implementation Document Management System at IPR Center of Universitas Jenderal Soedirman', 'The Document Management System (DMS), the Center for the Development of Intellectual Property Rights, is a web-based document management information system developed by the Center for Intellectual Property Development at Universitas Jenderal Soedirman. This system is used to archive documents digitally. However, because it did not work as intended by the user, the DMS Intellectual Property Rights Center did redesign both appearance and database relations. After the redesign process is complete, the SIMD Intellectual Property Rights Centres development results from the redesign need to be implemented in a production environment. For the implementation process to run well, it is necessary to analyze the factors that affect the deployment process with the implementation process in the widely used System Development Life Cycle (SDLC) model. By mapping these factors with the characteristics, advantages, and disadvantages of each SDLC implementation process, the V-shaped model\'s deployment process is more effective and efficient in its execution in a production environment. The results show that the results of this redesign procedure can solve the problems that have occurred so far.', 'Bina Nusantara University', '2023-05-31', 2023, 'DOI: 10.21512/emacsjournal.v5i2.9910', '', 'Engineering, MAthematics and Computer Science (EMACS) Journal', 'Vol. 5 No. 2 (2023): EMACS', '47-51', 'https://journal.binus.ac.id/index.php/EMACS/article/view/9910/4806', 6696255, NULL),
(3528256, '2 of 2', '2', 'Analisis Sistem Photovoltaic Beban Arus Searah Terhubung Jala PLN dengan Penyearah Terkendali', 'Photovoltaic (PV) systems can be connected to the utility grid to ensure the reliability and continuity of the electrical energy supply. Although the output of the PV modules and many electrical loads are direct current (DC), most grid connected PV systems use alternating current (AC) grid through the inverter. This study presents an analysis of DC microgrid PV system connected to PLN utility grid using controlled rectifier. The controlled rectifier circuit uses a thyristor which can be controlled at its ignition angle to regulate the output voltage and current supplied from utility. The proposed PV system configuration simulations are performed using PSIM software. The system supplies resistive loads in the form of DC lights. Simulations are carried out with variations in load resistance and the thytistor ignition angle. The simulation results show the rectifier circuit has a voltage ripple of 1.57 V (6.47%). While the efficiency of the system under various loading conditions and ignition angle varies between 95.08%97.72%. The highest system efficiency is obtained under high thyristor ignition conditions.', 'Universitas Syiah Kuala', '2020-08-12', 2020, 'DOI: 10.17529/jre.v16i2.15698', '', 'Jurnal Rekayasa Elektrika', 'Vol 16, No 2 (2020)', '', 'https://jurnal.usk.ac.id/JRE/article/view/15698/16_2_2_65_72', 6696255, NULL),
(3627528, '3 of 3', '', 'PPM Penerangan Tenaga Surya Untuk Fasilitas Umum Bagi Warga Desa Blater Dan Desa Sidakangen Kalimanah Purbalingga', 'Mobilitas warga di daerah pedesaan bergantung pada kondisi jalan sebagai sarana transportasi. Salah satu kondisi jalan yang dimaksud adalah ketersediaan penerangan di fasilitas umum warga. Fasilitas umum yang dimaksud antara lain bisa berupa jalan desa, jalan pertanian, lapangan, dan lainnya. Penerangan jalan yang baik akan mendukung banyak hal, terutama keamanan dan kenyamanan ketika warga masyarakat menggunakan fasilitas tersebut. Sebagai salah satu bentuk penerapan tridharma perguruan tinggi, perlu dilakukan kegiatan Pengabdian Pada Masyarakat (PPM) untuk membantu warga desa dalam mengatasi masalah tersebut. Dalam kegiatan kali ini, dilakukan kegiatan penerapan ilmu pengetahuan dan teknologi dalam bentuk implementasi pembangkit listrik surya sebagai sumber energi penerangan. Lokasi tujuan program PPM adalah jalan pertanian Desa Blater dan Sidakangen, Kecamatan Kalimanah, Kabupaten Purbalingga sebagai tindak lanjut dari kegiatan PPM sebelumnya. Hasil kegiatan menunjukkan adanya meningkatnya pengetahuan warga tentang pembangkit listrik tenaga surya, ketrampilan warga dalam proses instalasi tenaga surya beserta perawatannya. Selain itu, mobilitas warga pun lebih terbantu karena jalan lebih terang dari sebelumnya (gelap)', 'PT Berkah Tematik Mandiri', '2023-08-01', 2023, 'DOI: 10.61124/1.renata.8', '', 'RENATA: Jurnal Pengabdian Masyarakat Kita Semua', 'Vol. 1 No. 2 (2023): Renata - Agustus 2023 (In Press)', '', '', 6696255, NULL);
